import {doPostAsync} from "../http/http";
import authHeader from "../user/auth-header";
import {ip, tomcatPort} from '../../misc/constants';

/**
 * Gets the operating mode of a charger
 * @param id the charger's id
 * @returns {Promise<unknown>}
 */

const getChargerOperatingMode = (id) => {
        return doPostAsync(`http://${ip}:${tomcatPort}/api/charger/getOperatingMode`, {id: id}, authHeader());
}

export default getChargerOperatingMode;
